import { makeStyles } from '@material-ui/core/styles'
import Grid from '@material-ui/core/Grid'
import Card from '@material-ui/core/Card'
import DashbordItem from './dashboard-item'

const useStyles = makeStyles(theme => ({
  root: {
    marginTop: '25px'
  },
  cardBody: {
    padding: '10px'
  },
  cardTitle: {
    fontSize: '12px',
    backgroundColor: '#3F51B5',
    padding: '3px 3px 3px 6px',
    color: '#FFF',
    fontFamily: ["Roboto", "Helvetica", "Arial", "sans-serif"]
  }
}))

const ListDashboards = ({ dashboards, title }) => {
  const classes = useStyles()
  return (
    <Card className={classes.root}>
      <div className={classes.cardTitle}>{title}</div>
      <div className={classes.cardBody}>
        <Grid container spacing={2}>
          {dashboards.map((dashboard, index) => {
            const { title, description, id } = dashboard
            return (
              <Grid item xs={3} key={index}>
                <DashbordItem title={title} description={description} id={id}></DashbordItem>
              </Grid>
            )
          })}
        </Grid>
      </div>
    </Card >
  )
}

export default ListDashboards
